column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
nmcli では、JSON 設定データそのものと、設定を含むファイルの名前の両方を受け取ることができます。設定を含むファイルの名前を指定した場合は、そのファイルが読み込まれ、コンテンツがこのプロパティーに置かれます。

例: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

使い方: nmcli agent polkit { help }

nmcli を、ユーザーセッションの polkit アクションとして登録します。
polkit デーモンが承認を必要とする場合は、nmcli から承認を求められ、その応答を polkit に返します。

column1:
Usage: nmcli device set { ARGUMENTS | help }

ARGUMENTS := DEVICE { PROPERTY [ PROPERTY ... ] }
DEVICE    := [ifname] <ifname> 
PROPERTY  := { autoconnect { yes | no } |
             { managed { yes | no }

Modify device properties.

column3:
使い方: nmcli device set { ARGUMENTS | help }

ARGUMENTS := DEVICE { PROPERTY [ PROPERTY ... ] }
DEVICE    := [ifname] <ifname> 
PROPERTY  := { autoconnect { yes | no } |
             { managed { yes | no }

デバイスプロパティーを変更します。

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
使い方: nmcli general { コマンド | help }

コマンド := { status | hostname | permissions | logging }

  status

  hostname [<ホスト名>]

  permissions

  logging [level <ログレベル>] [domains <ログドメイン>]

column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
使い方: nmcli general status { help }

NetworkManager の全般情報を表示します。
'status' はデフォルトの動作となるため、'nmcli gen' を実行すると 'nmcli gen status' を実行したことになります。

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
使い方: nmcli networking { コマンド | help }

コマンド := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio { COMMAND | help }

COMMAND := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column3:
使い方: nmcli radio { コマンド | help }

コマンド := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
使い方: nmcli radio all { 引数 | help }

引数の種類 := [on | off]

すべてのラジオスイッチの状態を取得、またはオンかオフにします。

column1:
Usage: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of Wi-Fi radio switch, or turn it on/off.

column3:
使い方: nmcli radio wifi { 引数 | help }

引数 := [on | off]

Wi-Fi ラジオスイッチの状態を取得、またはオンかオフにします。

column1:
Usage: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of mobile broadband radio switch, or turn it on/off.

column3:
使い方: nmcli radio wwan { 引数 | help }

引数 := [on | off]

モバイルブロードバンドのラジオスイッチの状態を取得、またはオンかオフにします。
